import logo from './src/logos/m.g4.png';
import './Nav.css';

function Nav() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default Nav;
